        /// Registers all the input parameters for this component.
        /// </summary>
        protected override void RegisterInputParams(GH_Component.GH_InputParamManager pManager)
        {
            pManager.AddPlaneParameter("Base Plane", "P", "Plane defines the position and orientation of the base of the robot.", 0);
        }

        /// <summary>
        /// Registers all the output parameters for this component.
        /// </summary>
        protected override void RegisterOutputParams(GH_Component.GH_OutputParamManager pManager)
        {
            Param_ScriptVariable Robot = new Param_ScriptVariable();

            pManager.AddParameter(Robot, "Robot", "R", "Robot parameters and geometries.", GH_ParamAccess.item);

        }

